import React, { useState } from 'react';
// Import supabase from a utils file or wherever you have it initialized
// import { supabase } from '../utils/supabaseClient';

function HiringForm() {
  // Initialize state for each form field
  const [jobTitle, setJobTitle] = useState('');
  const [primaryRole, setPrimaryRole] = useState('');
  const [jobType, setJobType] = useState([]);
  const [jobLocation, setJobLocation] = useState('');
  const [jobDescription, setJobDescription] = useState('');

  // Handler for submitting the form
  const handleSubmit = async (e) => {
    e.preventDefault();
    // Here you would add the code to insert data into Supabase
    // For example:
    // const { data, error } = await supabase
    //   .from('jobs')
    //   .insert([
    //     { title: jobTitle, role: primaryRole, type: jobType, location: jobLocation, description: jobDescription },
    //   ]);
    // if (error) {
    //   console.error('Error inserting data: ', error);
    // } else {
    //   console.log('Data inserted: ', data);
    //   // Reset form or give user feedback
    // }
  };

  // Handler for checkbox changes
  const handleCheckboxChange = (e) => {
    const value = e.target.value;
    setJobType(
      e.target.checked
        ? [...jobType, value]
        : jobType.filter((type) => type !== value)
    );
  };

  return (
    <form onSubmit={handleSubmit} className="bg-white p-6 rounded shadow-md">
      <fieldset>
        <legend className="text-lg font-bold mb-4">Tell us about the position</legend>

        <label className="block mb-4">
          Job title
          <input 
            type="text"
            value={jobTitle}
            onChange={(e) => setJobTitle(e.target.value)}
            className="mt-1 block w-full"
            placeholder="e.g. Blockchain Engineer, Community Manager"
            required
          />
        </label>

        <label className="block mb-4">
          Primary role
          <select 
            value={primaryRole}
            onChange={(e) => setPrimaryRole(e.target.value)}
            className="mt-1 block w-full"
            required
          >
            <option value="">Select one</option>
            {/* Add options here */}
          </select>
        </label>

        <fieldset className="mb-4">
          <legend>Type of position</legend>
          <label><input type="checkbox" value="Full-Time" onChange={handleCheckboxChange} /> Full-Time</label>
          <label><input type="checkbox" value="Part-Time" onChange={handleCheckboxChange} /> Part-Time</label>
          <label><input type="checkbox" value="Contract" onChange={handleCheckboxChange} /> Contract</label>
          <label><input type="checkbox" value="Freelance" onChange={handleCheckboxChange} /> Freelance</label>
          <label><input type="checkbox" value="Internship" onChange={handleCheckboxChange} /> Internship</label>
        </fieldset>

        <fieldset className="mb-4">
          <legend>Job location</legend>
          <label><input type="radio" name="jobLocation" value="On Site" onChange={(e) => setJobLocation(e.target.value)} /> On Site</label>
          <label><input type="radio" name="jobLocation" value="On Site or Remote" onChange={(e) => setJobLocation(e.target.value)} /> On Site or Remote</label>
          <label><input type="radio" name="jobLocation" value="Remote" onChange={(e) => setJobLocation(e.target.value)} /> Remote</label>
        </fieldset>

        <label className="block mb-4">
          Job description
          <textarea 
            value={jobDescription}
            onChange={(e) => setJobDescription(e.target.value)}
            className="mt-1 block w-full"
            rows="4"
            required
          />
        </label>

        <button type="submit" className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
          Submit
        </button>
      </fieldset>
    </form>
  );
}

export default HiringPage;
